const BookView = ({ currentBook }) => {

  return (

  // <li key={currentBook.id}>
  <li>
    {console.log(currentBook.shelf)}
    <div className="book">
      <div className="book-top">
        <div
          className="book-cover"
          style={{
            width: 128,
            height: 188,
            backgroundImage:
              `url(${currentBook.imageLinks.smallThumbnail})`,
          }}
        ></div>
        <div className="book-shelf-changer">
          <select>
            <option value="none" disabled>Move to...</option>
            <option value="currentlyReading">Currently Reading</option>
            <option value="wantToRead">Want to Read</option>
            <option value="read">Read</option>
            <option value="none">None</option>
          </select>
        </div>
      </div>
      <div className="book-title">{currentBook.title}</div>
      <div className="book-authors">{currentBook.authors}</div>
      <div className="book-authors">{currentBook.shelf}</div>
    </div>
  </li>

)};

  export default BookView;
